import React from 'react';
import ReactDOM from 'react-dom';
import Testing from './Testing'


function Greeting() {
    return (
        <h2>Hi,</h2>
    )
}

ReactDOM.render(
    <>
        <h1>
            Hello
</h1>
        <Greeting />
        <Testing />
    </>

    ,
    document.getElementById('root')
)
